description:
This time she's fucking for her life! Veteran Joan Rambone is traveling cross-country when she passes through a small town and finds herself being hassled by the local sheriff and his deputies. They think she's just another typical drifter making her way through their quiet town. But they soon discover that Rambone is not typical at all. As the cops find themselves incapable of handling her sexual prowess and dangerous maneuvers, they realize that hassling her was a big mistake.

